import{_ as e}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as t,c as o,f as s}from"./app.ac77cf73.js";const i="data:image/png;base64,",d="/online-help-vuepress-hope/assets/clip0050.fa33584e.png",a={},c=s('<h1 id="working-with-lists-mrulist-last-entry-list" tabindex="-1"><a class="header-anchor" href="#working-with-lists-mrulist-last-entry-list" aria-hidden="true">#</a> Working with lists MRUList (last entry list)</h1><p>All editing control, as well as classes in the grid columns <code>TColumnEh</code> (For <code>DBGridEh</code>) and <code>TFieldRow</code> (For <code>DBVerGridEh</code>) contain a <code>MRUList</code> property.</p><p>This feature is designed to manage a list of the last entries. When you start typing in a text editor, the system displays a list of recently entered values and offers to choose from a list of one of the values to not gain it fully again.</p><p><img src="'+i+'" alt="" loading="lazy"></p><p><code>MRUList</code> starts only after activation. To activate <code>MRUList</code> set <code>MRUList.Active</code> property to <code>True</code>. You can complete the list of initial values, using the <code>MRUList.Items</code> property of <code>TStrings</code> type. When <code>MRUList</code> active and filled the <code>Items</code> property values, the text editor will display a special list editor under control, offering to choose one of the existing values list. At the same list of values will be limited to only those lines, the values that begin with the string contained in the editor. For a complete list of values, delete the text in the editor and press <code>VK_BACK</code>.</p><p>The list of <code>MRUList</code> values can be formed automatically on the basis of a list of unique values in the <code>DataSet</code>. To specify that the data should be taken from the <code>DataSet</code> set <code>MRUList.ListSourceKind</code> property to <code>lskDataSetFieldValuesEh</code>.</p><p><img src="'+d+'" alt="" loading="lazy"></p><p>Not all <code>DataSets</code> support access to the internal data structure for a list of unique values of a column. In the current version of the library <code>MRUList.ListSourceKind = lskDataSetFieldValuesEh</code> mode works for <code>DataSet</code> of <code>TMemTableEh</code> type. In one of the unit for your project it is necessary to add a <code>EhLibMTE</code> module in the uses clause. This module contains a class that is able get unique values for a field.</p><p>If your <code>DataSet</code> supports the ability to get a list of unique values for a field, then you can write and register your class inherited from <code>TDatasetFeaturesEh</code>. In the implementation of the class it must written a <code>FillFieldUniqueValues</code> method. See the example of the implementation in the <code>EhLibMTE.Pas</code> file.</p><p>The <code>TMRUListEh</code> class contains the following properties:</p><p><code>property AutoAdd: Boolean</code></p><dd>Automatically add new value to the list when the control lost input focus.</dd><p><code>property Active: Boolean</code></p><dd>MRUList is active</dd><p><code>property CaseSensitive: Boolean</code></p><dd>Search and filter text in the list of sensitive of case</dd><p><code>property Items: TStrings</code></p><dd>List of Values </dd><p><code>property Limit: Integer</code></p><dd>The maximum number of rows in the list. After reaching the limit value monitoring will delete the oldest value prior to the addition of new.</dd><p><code>property Rows: Integer</code></p><dd>The size of the list box. The size is given in text strings.</dd><p><code>property ListSourceKind: TMRUListSourceKindEh</code></p><dd><p>Defines a kind of source data for MRU DropDown list.</p><p><code>lskMRUListItemsEh</code> – source data for DropDown list will be taken from Items property.</p><p><code>lskDataSetFieldValuesEh</code> – source data for DropDown list will be taken from <code>DataSet</code>. For <code>DataSet</code> a <code>TDatasetFeaturesEh</code> class must be registered with implementing of <code>FillFieldUniqueValues</code> method to list of unique values for a dataset field.</p></dd>',24),l=[c];function r(n,p){return t(),o("div",null,l)}const f=e(a,[["render",r],["__file","06-mru-lists.html.vue"]]);export{f as default};
